import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useCookies } from 'react-cookie';

const MyPlaces = () => {
  const [cookies] = useCookies(['userId']);
  const [user, setUser] = useState(null);
  const [savedPlaces, setSavedPlaces] = useState([]);

  useEffect(() => {
    // Fetch logged-in user's data and saved places from the backend API
    const fetchData = async () => {
      try {
        const userDataResponse = await axios.get(`http://localhost:8000/user?userId=${cookies.userId}`)
        setUser(userDataResponse.data)
        console.log("User data response:", userDataResponse.data)

        if (userDataResponse.data && userDataResponse.data.saved_places) {
          const placeIds = userDataResponse.data.saved_places
          const placePromises = placeIds.map((placeId) => {
            return axios.get(`http://localhost:8000/save-places/${placeId}`)
          })

          const placesResponse = await Promise.all(placePromises)
          const placeDetails = placesResponse.map((response) => response.data)
          console.log("Saved places:", placeDetails)
          setSavedPlaces(placeDetails)
        } else {
          // User data or saved places not available
          setSavedPlaces([])
        }
      } catch (error) {
        console.log("Error fetching data:", error)
      }
    }

    fetchData()
  }, [cookies.userId])

  return (
    <div>
      <h1>List of Saved Places</h1>
      {savedPlaces.length === 0 ? (
        <p>No saved places found.</p>
      ) : (
        savedPlaces.map((place) => (
          <div key={place.place_id}>
            <h3>{place.place_name}</h3>
            <p>{place.place_street}</p>
            <p>
              {place.place_city}, {place.place_state} {place.place_zip}
            </p>
            <a href={place.place_url}>Website</a>
            <p>{place.place_about}</p>
          </div>
        ))
      )}
    </div>
  )
}

export default MyPlaces;
